__NUXT_JSONP__("/pec8fvwe3", (function(a,b){return {data:[{id:"pec8fvwe3",createdAt:a,updatedAt:b,publishedAt:a,revisedAt:b,title:"いろんなものを売ってきた",body:"\u003Cp\u003Eこんばんは！ @gamma_410 です。\u003Cbr\u003E今日は、ちょっと気分転換に部屋のお掃除をしていたら使っていないパソコンやらゲームやら沢山出てきたので OFF House で買い取ってもらいました。\u003Cbr\u003E\u003C\u002Fp\u003E\u003Ch2 id=\"hfbc8e593cb\"\u003E買取してもらったもの\u003C\u002Fh2\u003E\u003Cul\u003E\u003Cli\u003Eノートパソコン 2台\u003C\u002Fli\u003E\u003Cli\u003EiMac 1台\u003C\u002Fli\u003E\u003Cli\u003EPS2 1台\u003C\u002Fli\u003E\u003Cli\u003Eキーボード 1個\u003C\u002Fli\u003E\u003Cli\u003Eマウス 2個\u003C\u002Fli\u003E\u003Cli\u003Eヘッドフォン 1個\u003C\u002Fli\u003E\u003Cli\u003Eクラシックギター (初めて買った中古ギター) 1本\u003C\u002Fli\u003E\u003Cli\u003Eスピーカーアンプ 1個\u003C\u002Fli\u003E\u003Cli\u003Eその他ケーブル \u003C\u002Fli\u003E\u003Cli\u003Eスプラトゥーン2 \u003C\u002Fli\u003E\u003C\u002Ful\u003E\u003Cp\u003E\u003Cstrong style=\"color:#c16faa\"\u003E合計 9,400円\u003C\u002Fstrong\u003E\u003Cbr\u003E\u003Cbr\u003Eということで、詳しい値段までは覚えていませんが\bこんなにお金になりました。\u003Cbr\u003E新しいサービスのための貯金に回そうかな......\u003Cbr\u003E\u003Cbr\u003Eお部屋がすっきりしました、売ってよかった！\u003Cbr\u003Eみなさんも、不要になったもの売ってみてください！\u003Cbr\u003E\u003Cbr\u003Eおわり。\u003C\u002Fp\u003E"}],fetch:{},mutations:void 0}}("2022-04-03T13:10:33.304Z","2022-04-04T12:42:42.297Z")));